/** 
 * Flush a  {@link Flushable}, with control over whether an {@code IOException} may be thrown.<p>If  {@code swallowIOException} is true, then we don't rethrow{@code IOException}, but merely log it.
 * @param flushable the {@code Flushable} object to be flushed.
 * @param swallowIOException if true, don't propagate IO exceptionsthrown by the  {@code flush} method
 * @throws IOException if {@code swallowIOException} is false and{@link Flushable#flush} throws an {@code IOException}.
 * @see Closeables#close
 */
public static void flush(Flushable flushable,boolean swallowIOException) throws IOException {
  try {
    flushable.flush();
  }
 catch (  IOException e) {
    if (swallowIOException) {
      logger.log(Level.WARNING,"IOException thrown while flushing Flushable.",e);
    }
 else {
      throw e;
    }
  }
}

